script: |
  super -f text -I q2065.spq | sort > q2065.out

inputs:
  - name: q2065.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) AS cor0 WHERE + 65 / col1 NOT BETWEEN ( ( - 10 ) - 63 ) AND ( + 40 + col2 / - col2 );
  - name: tab0

outputs:
  - name: q2065.out
    data: |
      97	1	99
